import React from 'react';
import './'
const FeedbackStats = ({feedback}) => {
  return <div className='feedback-stats'>
<h3>{feedback.length} reviews</h3>
<h4>Average Rating : 8.0</h4>
  </div>;
};

export default FeedbackStats;
